import * as React from 'react';
import {StyleSheet, Text, Button, View, Image} from 'react-native';

export default function Home({navigation}) {
  
  const register = () => {
    navigation.navigate('Register');
  }
  return (
    <View style={styles.container}>
        <View style={styles.img}>
        <Image source={{
            uri:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTZuhMB5-Oc0mx_crs79-knPkixr5OuhqUnelJCiPLR7X293hgZZtuf_k61i6O4LWkzi6E&usqp=CAU',
            width:350,
            height:200,
        }}
        />
        </View>
     
      <Text style={styles.Heading}> Innovative-Tech </Text>
      <Text style={{fontSize:35, textAlign:'center', color:'blue', paddingBottom:10}}> Customers</Text>
      <View style={styles.homeButton}>
      <Button title="register" color="blue" onPress={register}/>
      </View>
     
    </View>
  );
};
const styles = StyleSheet.create({
    container:{
      flex:1,
     backgroundColor:'#fff',
     padding:50,
    },
    Heading:{
      fontSize:40,
      fontWeight:'bold',
      color:'blue',
      textAlign:'center',
      
    },
    homeButton:{
      justifyContent:'center',
      alignItems:'center',
      paddingTop:100,
      marginBottom:50,
    },
    img:{
        marginTop:40,
        alignItems:'center',
        
    }
  });
